import express from "express"
import Notes from "../models/NotesModel"
import Syllabus from "../models/syllabusModel"
import { isAuth, isCr } from "../utils"
import path from "path"
import multer from "multer"
import fs from "fs"
import { dirname } from "path"
import { fileURLToPath } from 'url';

// const __filename = fileURLToPath(import.meta.url);
// const __dirname = dirname(__filename);


const materialRouter = express.Router()


materialRouter.get("/:sem/:branch", isAuth, async (req, res) => {
    const sem = req.params.sem
    const branch = req.params.branch

    const materials = await Notes.find({ sem: sem, branch: branch })

    try {
        res.send(materials)
    } catch (error) {
        res.status(500).send({ message: error })
    }

})


materialRouter.get("/:sem/:branch/:type", isAuth, async (req, res) => {
    const sem = req.params.sem
    const branch = req.params.branch
    const type = req.params.type
    try {
        const syllabus = await Syllabus.find({ sem: sem, branch: "mechanical", type: type })
        res.send(syllabus)
    } catch (error) {
        res.status(500).send({ message: error.message })
    }

})

materialRouter.use(express.static(path.join(__dirname, "/uploads/")))

const storage = multer.diskStorage({

    destination: function (req, file, cb) {
        cb(null, path.join(__dirname, '/uploads'))
    },
    filename: function (req, file, cb) {

        cb(null, file.fieldname + Date.now() + path.extname(file.originalname))
    }
})

const upload = multer({
    storage: storage,
    limits: { fileSize: 30 * 1024 * 1024 }
}).single("file")





materialRouter.post("/create/studyMaterial", upload, isAuth, isCr, async (req, res) => {
    const file = req.file
    try {
        const notes = new Notes({
            subject: req.body.subName,
            sem: req.body.sem,
            branch: req.body.branch,
            professor: req.body.nameProf,
            date: Date.now(),
            doc: {
                data: fs.readFileSync(path.join(__dirname + '/uploads/' + file.filename)),
                contentType: file.mimetype
            }
        })
        const newNote = notes.save()


        res.send({ messsage: "studymaterial upload success" })

        fs.unlinkSync(path.join(__dirname + '/uploads/' + file.filename))

    } catch (error) {
        res.status(500).send({ message: error.message })
    }

})



materialRouter.post("/create/syllabusUpload", upload, isAuth, isCr, async (req, res) => {
    const file = req.file

    try {
        const syllabus = new Syllabus({
            type: req.body.type,
            sem: req.body.sem,
            branch: req.body.branch,
            subject: req.body.subject,
            date: Date.now(),
            doc: {
                data: fs.readFileSync(path.join(__dirname + '/uploads/' + file.filename)),
                contentType: file.mimetype
            }
        })

        const newNote = syllabus.save()


        res.send({ messsage: "syllabus upload success" })

        fs.unlinkSync(path.join(__dirname + '/uploads/' + file.filename))

    } catch (error) {
        res.status(500).send({ message: error.message })
    }

})

materialRouter.post("/view/:id", isAuth, async (req, res) => {

    const id = req.params.id

    try {
        const viewMaterial = await Notes.findById(id)
        if (viewMaterial) {
            res.send(viewMaterial)

        } else {

            const viewSyllabus = await Syllabus.findById(id)
            res.send(viewSyllabus)
        }
    } catch (error) {
        res.status(500).send({ message: error.message })
    }

})


export default materialRouter;

