    try {
        res.send(crs)

    } catch (error) {
        res.status(500).send({message : error.message})
    }

})


connectRouter.get("/members" , async (req ,res)=>{
    

    try {
        const members = await Members.find({})
        res.send(members)
    } catch (error) {
        res.status(500).send({message : error.message})
    }

})

