import express from "express"
import Notes from "../models/NotesModel"
import Syllabus from "../models/syllabusModel"
import { isAuth, isCr } from "../utils"
import path from "path"
import fileUpload from "express-fileupload"


const materialRouter = express.Router()


materialRouter.get("/:sem/:branch/:count", async (req, res) => {
    const sem = req.params.sem
    const branch = req.params.branch
    const count = req.params.count

    const materials = await Notes.find({ sem: sem, branch: branch },{ subject: 1 , professor:1})

    try {
        res.status(200).send(materials)
    } catch (error) {
        res.status(500).send({ message: error })
    }


})


materialRouter.get("/:sem/:branch/:type", async (req, res) => {
    const sem = req.params.sem
    const branch = req.params.branch
    const type = req.params.type


    try {
        const syllabus = await Syllabus.find({ sem: sem, branch: branch, type: type } , { subject: 1 , professor: 1 , type :1})
        res.send(syllabus)
    } catch (error) {
        res.status(500).send({ message: error.message })
    }

})

materialRouter.use(express.static(path.join(__dirname, "uploads")))

materialRouter.use(fileUpload())



